        function handleFiles(files) {

            var matchedNodes = [];
            document.getElementById('matches').innerText = "";

            var file = files[0];

            var reader = new FileReader();
            reader.onload = function (progressEvent) {
                // Entire file
                console.log(this.result);

                // By lines
                var lines = this.result.split('\n');
                for (var line = 0; line < lines.length; line++) {
                    console.log(lines[line]);
                    founderMasternodes.forEach(function (element) {
                        if (lines[line].includes(element)) {
                            matchedNodes.push(element);
                        }
                    });
                }

                if (matchedNodes.length == 0) {
                    document.getElementById('matches').innerText = "No matches found."
                } else {
                    document.getElementById('matches').appendChild(makeUL(matchedNodes));
                }
            };
            reader.readAsText(file);
        };

        function makeUL(array) {
            // Create the list element:
            var list = document.createElement('ul');

            for (var i = 0; i < array.length; i++) {
                // Create the list item:
                var item = document.createElement('li');

                // Set its contents:
                item.appendChild(document.createTextNode(array[i]));

                // Add it to the list:
                list.appendChild(item);
            }

            // Finally, return the constructed list:
            return list;
        };
    </script>

    </form>
    <div id="matches"></div>
